    <script>
        // return protoze ten promise
        async function remT(pizzaId) {
            return $.ajax({
                type: "POST",
                url: 'RemoveTopping.php',
                data: ({pizza: pizzaId}),
            });
        }
        async function remT(pizzaId, toppingId) {
            return $.ajax({
                type: "POST",
                url: 'RemoveTopping.php',
                data: ({pizza: pizzaId,
                topping: toppingId}),
            });
        }
        async function removeTopping(pizzaId) {
            remT(pizzaId).then((res) => {
                console.log(res)
                location.reload(true);
            });
        }
        async function removeTopping(pizzaId, toppingId) {
            remT(pizzaId, toppingId).then((res) => {
                console.log(res)
                location.reload(true);
            });
        }
    </script>

